import React from 'react';
import icon from '../../assets/pix-icon.svg';
import Context from '../../config/Context';

//if equals true, then remove display none, apply animation
const PiXIcon = (props: any) => {
  return(
    <Context.Consumer>
      {context => (
        <React.Fragment>
          <header className="PiXIcon">
            <div className="PiXIcon-Component">
              <img className="PiX-Icon" onClick={this.context.toggleSidePanel} src={icon} alt="icon"/>
            </div>
          </header>
        </React.Fragment>
      )}
    </Context.Consumer>

  );
}

export default PiXIcon;
